import { TestBed } from "@angular/core/testing";
import { MockProvider } from "ng-mocks";
import { HttpClient } from "@angular/common/http";
import { CourseOverviewService } from "src/app/services/course-overview.service";
import { CourseOverviewComponent } from "./course-overview.component";
import { CourseOverviewModel } from "src/app/models/course-overview.model";
import { of } from "rxjs";
import { RouterTestingModule } from "@angular/router/testing";
describe('Component: CourseOverview', () => {
    let httpMock;
    let courseOverviewService;
    let sut;
    beforeEach(async () => {
        TestBed.configureTestingModule({
            declarations: [CourseOverviewComponent],
            providers: [
                MockProvider(HttpClient),
                MockProvider(CourseOverviewService),
                CourseOverviewModel
            ],
            imports: [RouterTestingModule]
        }).compileComponents();
        sut = TestBed.createComponent(CourseOverviewComponent).componentInstance;
    });
    it('should create', () => {
        expect(sut).toBeTruthy();
    });
    it('should return a list of courseoverviewmodels', () => {
        const courseOverviewService = TestBed.get(CourseOverviewService);
        const spy = spyOn(courseOverviewService, 'refreshCursusLijst').and.returnValue(of([]));
        sut.ngOnInit();
        expect(spy).toHaveBeenCalled();
    });
});
